import React, { useEffect, useState } from "react";
import { BrowserRouter as Router, Switch, Route,  } from "react-router-dom";
import Home from "./Home";
import Navbar from "./Navbar";

function App() {
    return (
      <div>
        <Router>
      <div>
        <nav>
          <ul>
            <li>
              <Link to="/">Home</Link>
            </li>
          </ul>
        </nav>
        <Switch>
          <Route path="/about">
            <About />
          </Route>
          <Route path="/users">
            <Users />
          </Route>
          <Route path="/">
            <Home />
          </Route>
        </Switch>
      </div>
    </Router>
    </div>
    );
  }

  export default App;
